import React from 'react';
import { Card, CardContent, Typography, Button } from '@mui/material';
import "./custumlist.css"

const CustomList = ({ rows , onSelect}) => {
  return (
    <div style={{ display: 'flex', flexDirection: 'column', gap: '20px', width: '100%' }}>
      {rows.map((row, index) => (
        <Card key={index} raised style={{ padding: '10px' }}>
          <CardContent>
            <Typography variant="h5">{row.name}</Typography>
            <Typography color="textSecondary">{row.telephoneNumber}</Typography>
            <Typography variant="body2">{row.address}</Typography>
            <Typography variant="body1">{row.price} TL</Typography>
            <Button
              variant="contained"
              color="primary"
              onClick={() => onSelect(row)}
              style={{ marginTop: '10px' }}
            >
              Se√ß
            </Button>
          </CardContent>
        </Card>
      ))}
    </div>
  );
};

export default CustomList;
